import React from "react";
import {Link} from 'react-router-dom';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

import {faFacebook} from '@fortawesome/free-brands-svg-icons';

import {faInstagram} from '@fortawesome/free-brands-svg-icons';

import {faTwitter} from '@fortawesome/free-brands-svg-icons';

import {faGoogle} from '@fortawesome/free-brands-svg-icons';


const Menu = () =>{

    return(
        <>
            
            <div className="menu-style">
            <h1>portfolio website of <strong className="brand_name"> ghani</strong></h1>
            <Link  to= '/' >home</Link>
            <Link  to= '/mainabout/about' >About</Link>
            <Link  to= '/project' >Projects</Link>
            <Link to = '/fb' > <FontAwesomeIcon icon = {faFacebook} /></Link>
            <Link to ='/insta' > <FontAwesomeIcon icon={faInstagram} /></Link>
            <Link to ='/twitter' > <FontAwesomeIcon icon={faTwitter} /></Link>
            <Link to ='/google' > <FontAwesomeIcon icon={faGoogle} /></Link>
            
            </div>
        </>
    )
}

export default Menu;
